package com.example;

import org.camunda.bpm.engine.delegate.DelegateExecution;
import org.camunda.bpm.engine.delegate.JavaDelegate;
import org.camunda.bpm.engine.variable.Variables;

public class VariableSerialization implements JavaDelegate {

    @Override
    public void execute(DelegateExecution execution) throws Exception {
       // execution.setVariable("zmiennaDoSerializowania","");
        execution.setVariable("zmiennaDoSerializowaniaJava",
                Variables.objectValue("").serializationDataFormat(Variables.SerializationDataFormats.JAVA).create());
        execution.setVariable("zmiennaDoSerializowaniaJSON",
                Variables.objectValue("").serializationDataFormat(Variables.SerializationDataFormats.JSON).create());
        execution.setVariable("zmiennaDoSerializowaniaXML",
                Variables.objectValue("").serializationDataFormat(Variables.SerializationDataFormats.XML).create());



    }
}
